import styled from 'styled-components';

const Styled = styled.div`
    .set-scroll .ant-tabs-tab {
        padding: 10px;
    }
    .ant-tabs-nav-wrap {
        background-color: #d5d8e0;
    }

    button {
        height: 36px;
        margin: 0 5px;
        border: none;
    }
    .btn-action {
        z-index: 99;
        position: absolute;
        bottom: 0;
        width: 100%;
        padding: 10px;
        background: #fff;
        left: 0;
        right: 0;
        display: flex;
        justify-content: center;
        -webkit-box-shadow: 1px 0px 10px 0px rgba(0, 0, 0, 0.1);
        box-shadow: 1px 0px 10px 0px rgba(0, 0, 0, 0.1);
    }
    .btn-close {
        background-color: orange;
        color: #fff;
    }
    .btn-close:hover {
        background-color: #ffb833;
        color: #fff;
    }
    .btn-save {
        background-color: green;
        color: #fff;
    }
    .btn-save:hover {
        background-color: #009900;
        color: #fff;
    }
    .btn-register {
        background-color: #0d5ac3;
        color: #fff;
    }
    .btn-register:hover {
        background-color: #3365a9;
        color: #fff;
    }
    .btn-register:disabled {
        background-color: #839bbc;
    }
`;
export default Styled;
